// import SecureCallService from "./patientaxios";
// import '../patient/add.css'
class Addproduct extends Component {
  constructor(props) {
    super(props);
    this.state = {}
  }
  render() {
    return (
      <>
       <Navbar style={{background:'black',width:1089 ,height:60}} >
          {/* <ul><input type="button" value="P a t i e n t D e a t i l s" style={{width:300}} className='btn' onClick={this.getValues.bind(this)}/> </ul> */}
          {/* <ul><NavLink link to onClick={this.getValues.bind(this)}  ClassName='active'>Patient Details</NavLink></ul> */}
          {/* <ul> <NavLink link to='/patient/Addpatient' ClassName='active'>Add Patient</NavLink></ul>  */}
          </Navbar>
      <br/><br/><br/>
      <div  align='center' class="card" style={{width:1089, margin:0 }} >
      <br/><br/>
        <form style={{width:1089}}>
               <h3 align='center'>Register New Patient </h3> 
              
          </form>
      </div>
      </>

    );
  }
}

export default Addproduct;
